INSERT INTO `freeform_feed_messages` VALUES (1,2,'Freeform 3.11 is now available! New features include the ability to edit other Craft Elements and map to Calendar Events with the Element Connections feature, full-screen HTML & Twig and Rich Text editor inside the form builder, ability to update file-based email notification templates directly inside the CP, support for searching by submissions\' field values in the CP Submissions index, more granular submission viewing and management permissions, ability to lazy load reCAPTCHA scripts, various improvements to the Freeform JS plugin, and a wide variety of other improvements!','[]','info',1,'2021-04-20 06:00:00','2021-05-11 08:16:23','2021-11-01 10:10:38','99607100-cd39-4120-b0ed-3ff13ed6b663'),(2,4,'Added the ability to edit other Craft Elements, including special support for Craft Users (Pro).','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','1e975932-ea3f-444f-a0d7-49014d5a8812'),(3,4,'Added the ability to map to Calendar Events with the Element Connections feature (Pro).','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','6b91fdac-b7b4-4c99-bd00-e31de6c53353'),(4,4,'Added a full-screen HTML & Twig and Rich Text editor inside the form builder.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','de2ffcc5-73ca-4ccd-b81d-dad114354ad0'),(5,4,'Added the ability to update file-based email notification templates directly inside the CP (optional). Included a migration tool for migrating from Database to File-based email notifications.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','1c619ade-3272-4ace-8665-5ba6c1649e7b'),(6,4,'Added support for searching by submissions\' field values in the CP Submissions index.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','52d5903e-b364-42b1-9f05-473e81fb9b82'),(7,4,'Added more granular submission viewing and management permissions. You can now set read-only permissions in addition to management permissions.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','774c8878-851d-4756-a239-5da2cbe5c3fd'),(8,4,'Added a setting that allows you to optionally restrict the Forms element field type to only show forms which the user has manage permissions for.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','7c07495d-d33f-4ac6-a2ed-81d72f980599'),(9,4,'Added ability to load reCAPTCHA scripts (and checkbox field if using v2 Checkbox) only once the site visitor interacts with the form.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','63b4ac44-8004-432d-b1e3-20e07fda8ad9'),(10,4,'Added export profile developer events, allowing the addition of custom exporters.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','074d6e22-1d67-4a65-9d67-62c8c75309df'),(11,4,'Various improvements to Freeform\'s JS, including optimization to no longer include excess polyfills, no longer fetching field-specific scripts if the fields aren\'t present in the form, loading the JS as a separate \'freeform/plugin.js\' file path, and \'freeform.loadFreeformPlugin()\' to load the JS manually in your template.','[]','new',1,'2021-04-20 13:00:00','2021-05-11 13:16:44','2021-11-01 10:10:40','826ad95c-6950-4e5e-b220-925baada6e57'),(12,6,'The Freeform 3.12 beta is now underway! New features include a new Drag & Drop File Upload field type, improved form processing, self-diagnostics page and many other additions, improvements and fixes! If you\'d like to be a part of the 3.12 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html','[]','info',1,'2021-09-02 13:03:00','2021-11-01 10:08:42','2021-11-01 10:10:38','dcf4cb8c-5d3e-4858-a866-3ccfbb7f228b'),(13,8,'Check out the Freeform 3.12 beta! It includes a new SAVE & CONTINUE LATER feature that allows your users to save their form progress and come back at a later time to complete the form! Also included is a new PREMIUM FILE UPLOAD field type that shows file thumbnails and upload progress, as well as memory of the uploaded file(s) if there\'s an error on submit or editing an existing submission, etc. If you\'d like to be a part of the 3.12 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html','[]','info',1,'2021-11-05 13:00:00','2021-11-08 10:57:57','2022-11-01 15:12:22','275d7306-1b46-4ff9-84c8-04cf7e5b43f1'),(14,9,'Freeform 3.12 is now available! It includes a wide range of new features and significant improvements to performance and reliability. Introducing the new SAVE & CONTINUE LATER feature that allows your users to save their form progress and come back at a later time to complete the form! Also included is the ability to limit how many submissions a form can have and a new PREMIUM FILE UPLOAD field type that shows file thumbnails and upload progress, as well as memory of the uploaded file(s) if there\'s an error on submit or editing an existing submission, etc.','[]','info',1,'2021-11-14 14:00:00','2021-11-15 12:02:46','2022-11-01 15:12:22','f16f4735-2186-4efa-ad9c-2eb0d78645e5'),(15,11,'Freeform 3.13 is now available! Exciting new features include handling Success Behavior of forms directly inside the form builder, the ability to set Close Dates on forms, restrict forms to logged-in users only (and other combinations), storing of author IDs of logged-in users that submit forms (and accessing that author data throughout the control panel and front end), and the addition of the Surveys & Polls form type! For more information, visit: https://docs.solspace.com/freeform/news','[]','info',1,'2022-02-28 14:00:00','2022-03-15 09:29:37','2022-11-01 15:12:22','53f82418-02c1-43aa-9d74-29888b506507'),(16,12,'Would you be willing to take a few minutes to complete a survey about your experience with Freeform? We value your feedback and you will also be entered into a draw to win a $100* Amazon gift card! It should only take a couple of minutes and you can remain anonymous if you like. Visit the following link to complete: https://solspace.typeform.com/to/ajYYOwK2\n  *For those participants outside the USA, we can provide an Amazon gift card suitable for your country of residence.','[]','info',1,'2022-01-20 14:00:00','2022-03-15 09:29:37','2022-11-01 15:12:22','ef30b837-9bec-479c-9987-b47475b076eb');
